import { IoIosSearch } from 'react-icons/io'
import { useState } from 'react'
export default function SearchBox({setSearch}) {
    return(
        <div className='flex no-wrap h-8 w-2/6 border border-black m-5'>
            <IoIosSearch className='w-8 my-auto'/>
            <input className='w-full outline-none' name='search' placeholder='Search Everywhere' onSubmit={ e => setSearch(e) }/>
        </div>
    )
}
